import React from 'react';
import './App.css';
import './bootstrap.min.css';
import Createpokemon from './Createpokemon.js'



class Header extends React.Component{
	constructor(props){
		super(props);
		this.state = {
			view : []
		}
	}
	_displayPokemon (){
		console.log(this.props)
		this.setState({view : <Createpokemon />});
	}
	render(){
		return(
			<div>
				<row>
					<nav class="navbar navbar-expand-lg navbar-light bg-light">
					  <a class="navbar-brand" href="#">Pokemon wiki</a>
					  <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavDropdown" aria-controls="navbarNavDropdown" aria-expanded="false" aria-label="Toggle navigation">
					    <span class="navbar-toggler-icon"></span>
					  </button>
					  <div class="collapse navbar-collapse" id="navbarNavDropdown">
					    <ul class="navbar-nav">
					      <li class="nav-item">
					        <a class="nav-link" href="#" onClick={() => {this._displayPokemon()}}>Create team</a>
					      </li>
					      <li class="nav-item">
					        <a class="nav-link" href="#">Pokedex</a>
					      </li>
					      <li class="nav-item dropdown">
					        <a class="nav-link dropdown-toggle" href="#" id="navbarDropdownMenuLink" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
					          Dropdown link
					        </a>
					        <div class="dropdown-menu" aria-labelledby="navbarDropdownMenuLink">
					          <a class="dropdown-item" href="#">Action</a>
					          <a class="dropdown-item" href="#">Another action</a>
					          <a class="dropdown-item" href="#">Something else here</a>
					        </div>
					      </li>
					    </ul>
					  </div>
					</nav>
				</row>
			</div>
		)
	}	
}

export default Header;
